        //Siparişleri ul içerisine sırala. Gecikmiş siparişleri KIRMIZI yaz. GEcikmiş sipariş demek requiredData < shippedDate ise gecikmiş bir sipariştir.

        orders.forEach(item => {
           
            var trElement = document.createElement("tr");

            var tdElement1 = document.createElement("td");
            tdElement1.innerHTML = item.id;
            trElement.appendChild(tdElement1);

            var tdElement2 = document.createElement("td");
            tdElement2.innerHTML = item.customerId;
            trElement.appendChild(tdElement2);

            var tdElement3 = document.createElement("td");
            tdElement3.innerHTML = moment(item.orderDate).format("DD/MM/YYYY dddd");
            trElement.appendChild(tdElement3);

            var tdElement4 = document.createElement("td");
            tdElement4.innerHTML = moment(item.requiredDate).format("DD/MM/YYYY dddd");
            trElement.appendChild(tdElement4);

           var tdElement5 = document.createElement("td");
           //difference days requiredDate shippedDate
           tdElement5.innerHTML = moment(item.orderDate).diff(item.shippedDate, 'days')
           trElement.appendChild(tdElement5)


            document.querySelector("tbody").appendChild(trElement);

        })
